import React, { Component } from "react";
import { Navbar } from "../../node_modules/react-bootstrap";
import { InputGroup } from "../../node_modules/react-bootstrap";

class Bonds extends Component {
    render() {
        return (
            <React.Fragment>
                <Navbar bg="dark" variant="dark">
                    <Navbar.Brand>Bond Pricing</Navbar.Brand>
                </Navbar>
                <InputGroup>
                    <InputGroup.Prepend>
                        <InputGroup.Text>UPLOAD</InputGroup.Text>
                    </InputGroup.Prepend>
                </InputGroup>
            </React.Fragment>
        )
    }
}

export default Bonds;
